import React from "react";
import ChatBox from "./components/ChatBox";

function App() {
  return (
    <div style={{ maxWidth: "600px", margin: "50px auto", fontFamily: "Arial, sans-serif" }}>
      <h1 style={{ textAlign: "center" }}>Campus Chatbot</h1>
      <ChatBox />
    </div>
  );
}

export default App;
